//Especificamos la version
pragma solidity >=0.4.4 <0.7.0;

contract CausasBeneficas{

    // Declaraciones necesarias
    struct Causa{
        uint id;
        string nombre;
        uint recaudacion_objetivo;
        uint dinero_recaudado;
    }

    uint contador_causas = 0;

    mapping(string => Causa) causas;

    function nuevaCausa(string memory _nombre, uint _recaudacion_objetivo) public {
        contador_causas = contador_causas++;
        Causa memory causa = Causa(contador_causas,_nombre,_recaudacion_objetivo,0);
    }


}

